import React from "react";
import telephone from './images/telephone-icon.jpg' 
import email from './images/envelope-icon.png'
export default function Contact(props) {
    const keys = Object.keys(props);
    console.log(keys);
    return (
        <section className="section">
            <div className="below-sect">
                <img src={props.img} alt='a pretty bubble' className='contact-photo'/>
                <h1>{props.name}</h1>
                <div className="icon-container">
                    <img src={telephone} alt='telephone icon' className="icon"/>
                    <p>{props.phone}</p>
                </div>
                <div className="icon-container">
                    <img src={email} alt='email icon' className="icon"/>
                    <p></p>
                </div>
            </div>
        </section>
    )
}
